import React from "react";


function Articls(props){
    return(
    <>
        <div className="container-articls">
            <div className="container-img">
                <img src={props.img} alt="images" />

            </div>
            <div className="container text">
                <h1>{props.nmb}</h1>
                <h3>{props.titre}</h3>
                <p>{props.sousTitre}</p>

            </div>
        </div>
    </>
    );
}

export default Articls;
